import React from "react";

const TodoList = (props) => {
    const {inputText, taskList} = props
    return (
        <div className="todo-container">
            <ul className="todo-list">

                {taskList.forEach(item=> {
                    return (
                        <li>{item}</li>
                    )
                })}
            </ul>
        </div>
    )
}

export default TodoList
